import React, { useState, useEffect } from 'react';
import { Button, Modal, ModalHeader, ModalBody, ModalFooter } from 'reactstrap';
import variables from './../variables';

function Prescriptions() {
    const [prescriptions, setPrescriptions] = useState([]);
    const [modal, setModal] = useState(null);

    useEffect(() => {
        fetch(variables.API_URL + 'prescription/')
            .then(res => res.json())
            .then(data => {
                setPrescriptions(data);
            });
    }, []);

    const toggle = (index) => {
        setModal(modal === index ? null : index);
    }

    return (
        <div>
            {prescriptions.map((prescription, index) => (
                <div key={index}>
                    <Button color="primary" onClick={() => toggle(index)}>
                        View Prescription #{index + 1}
                    </Button>
                    <Modal isOpen={modal === index} toggle={() => toggle(index)}>
                        <ModalHeader toggle={() => toggle(null)}>Prescription #{index + 1}</ModalHeader>
                        <ModalBody>
                            <div className="row">
                                <div className="col-md-6">
                                    <strong>Doctor:</strong> {prescription.doctors.doctor_name}
                                </div>
                                <div className="col-md-6">
                                    <strong>Booklet No:</strong> {prescription.booklets.booklet_no}
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-md-12">
                                    <strong>Complaints:</strong> {prescription.complaints}
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-md-12">
                                    <strong>Diagnosis:</strong> {prescription.diagnosis}
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-md-12">
                                    <strong>Rx:</strong> {prescription.rx}
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-md-12">
                                    <strong>Investigation:</strong> {prescription.investigation}
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-md-12">
                                    <strong>Lifestyle:</strong> {prescription.lifestyle}
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-md-12">
                                    <strong>Last Checkup Id:</strong> {prescription.last_checkup_id}
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-md-12">
                                    <strong>Pulse Rate:</strong> {prescription.pulse_rate}
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-md-12">
                                    <strong>BP:</strong> {prescription.bp}
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-md-12">
                                    <strong>Temperature:</strong> {prescription.temp}
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-md-12">
                                    <strong>Weight:</strong> {prescription.weight}
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-md-12">
                                    <strong>Age:</strong> {prescription.age}
                                </div>
                            </div>
                           
                        </ModalBody>
                        <ModalFooter>
                            <Button color="secondary" onClick={() => toggle(null)}>Cancel</Button>
                        </ModalFooter>
                    </Modal>
                </div>
            ))}
        </div>
    );
}

export default Prescriptions;
